import React from 'react';

interface IReimbursementCardProps {
  reimbursement: any;
}

export class ReimbursementCardComponent extends React.PureComponent<IReimbursementCardProps> {
  render() {
    const reimbursements = this.props.reimbursement;
    return (
      <div className="card col-md-4 col-sm-6 col-xs-12">
        <img src="https://thenewswheel.com/wp-content/uploads/2018/05/Millennium-Falcon-760x428.jpg"
          className="card-img-top"
          alt="..." />
        <div className="card-body">
          <h5 className="card-title">{reimbursements.reimbursement_id}</h5>
        </div>
        <ul className="list-group list-group-flush">
          <li className="list-group-item">reimbursement_id: {reimbursements.reimbursement_id}</li>
          <li className="list-group-item">author: {reimbursements.author}</li>
          <li className="list-group-item">date_submitted: {reimbursements.date_submitted }</li>
          <li className="list-group-item">date_resolved: {reimbursements.date_resolved }</li>
          <li className="list-group-item">description: {reimbursements.description }</li>
          <li className="list-group-item">status: {reimbursements.status }</li>
          <li className="list-group-item">
            <button className="btn btn-danger">Delete</button>
          </li>
        </ul>
      </div>
    )
  }
}
